        Delivery Scheduled for
      </Text>
      <View style={[styles.september142023Wrapper, styles.wrapperFlexBox]}>
        <Text style={[styles.september142023, styles.september142023Clr]}>
          September 14, 2023
        </Text>
      </View>
      <View
        style={[
          styles.submissionDeadlineSept7Wrapper,
          styles.wrapperSpaceBlock,
        ]}
      >
        <Text
          style={[styles.september142023, styles.september142023Clr]}
        >{`Submission Deadline: Sept 7 `}</Text>
      </View>
      <Image
        style={[styles.iphoneXTopNavbarLight, styles.importContactsIcon1Layout]}
